import React from 'react'

function NewsEvents() {
  return (
    <div className="container-fluid bg-primary bg-testimonial py-5 my-5 wow fadeInUp" data-wow-delay="0.1s">
            <div className="nae">
                <h1>Business Networking Lunch</h1>
                <p>Time: Thursday 12th October from 12:30-14:00</p>
                <p>Location: Vermont South Neighbourhood House</p>
            </div>
    </div>
  )
}

export default NewsEvents
